import React, { useContext } from "react";
import {
  Container,
  Navbar as NavbarComp,
  Nav,
  NavDropdown,
} from "react-bootstrap";
import { Link, useHistory } from "react-router-dom";
import { userContext } from "../context/userContext";
import booksLogo from "../assets/books-logo.png";
import cartIcon from "../assets/cart-icon.png";

function NavbarUser(props) {
  const [dispatch] = useContext(userContext);

  let history = useHistory();

  const logout = () => {
    dispatch({
      type: "LOGOUT",
    });
    history.push("/auth");
  };

  return (
    <NavbarComp expand="lg">
      <Container>
        <NavbarComp.Brand as={Link} to="/">
          <img
            src={booksLogo}
            className="img-fluid"
            style={{ width: "60px", height: "60px" }}
            alt="brand"
          />
        </NavbarComp.Brand>

        <NavbarComp.Toggle aria-controls="basic-navbar-nav" />
        <NavbarComp.Collapse id="basic-navbar-nav">
          <Nav className="ms-auto">
            <Nav.Link
              as={Link}
              to="/cart"
              className={
                props?.title == "Cart" ? `text-navbar-active` : `text-navbar`
              }
            >
              <img src={cartIcon}></img>
            </Nav.Link>

            <NavDropdown>
              <Nav.Link
                as={Link}
                to="/profile"
                className={
                  props?.title == "Profile"
                    ? `text-navbar-active`
                    : `text-navbar`
                }
              >
                Profile
              </Nav.Link>
              <Nav.Link
                as={Link}
                to="/complain"
                className={
                  props?.title == "Complain"
                    ? `text-navbar-active`
                    : `text-navbar`
                }
              >
                Complain
              </Nav.Link>
              <Nav.Link onClick={logout} className="text-navbar">
                Logout
              </Nav.Link>
            </NavDropdown>
          </Nav>
        </NavbarComp.Collapse>
      </Container>
    </NavbarComp>
  );
}

export default NavbarUser;
